import React from 'react';
import "./Style/HomePage.css";


const Profile = ({ genre, image }) => {
  return (
    <div className="genre">
      <img src={image} alt={genre} />
      <p>{genre}</p>
    </div>
  );
};

export default function HomePage() {
  const genres = [
    { name: "Persona", image: "/pictures/persona.png" },
    { name: "Rock", image: "/pictures/PierceTheVeil.png" },
    { name: "Punk", image: "/pictures/GreenDay.png" },
    { name: "Indie", image: "/pictures/ArcticMonkeys.png" },
    { name: "Rap", image: "/pictures/Kendrick.png" },
  ];

  return (
    <section>
      <h1>Genres</h1>
      <div className="genres">
        {genres.map((genre, index) => {
          return <Profile key={index} genre={genre.name} image={genre.image} />;
        })}
      </div>
    </section>
  );
}
